import { Segment,Form, Header as Head, Button } from 'semantic-ui-react'
import { useDispatch, useSelector } from "react-redux";

export const Header = (props) => {
    const [currentUser, setCurrentUser] = useState({
        id: "",
        surname: "theyoo",
        lastname: "",
        img: "",
        login: "",
        pwd: "",
        money: 100,

    });

    return (
        <Segment>
            <Head as='h1' dividing>
                {currentUser.money}
            </Head>
            <Head as='h1' dividing>
                {props.title}
            </Head>
            <Head as='h1' dividing>
                {currentUser.surname}
            </Head>
        </Segment>

    );

}
